window.draw_stimulus = 
(component, position, rotation, target, display_function, 
costum_x=NaN, costum_y = NaN, serial_number = 1) => {


  var x = (Number.isNaN(costum_x)) ? ((position % 10) * 32 - 160) : costum_x
  var y = (Number.isNaN(costum_y)) ? Math.floor(position / 10) * 32 - 160 : costum_y


  switch (display_function) {
    
    case 1:
    component.options.content.push({
      type: 'text',
      left: x, top: y, angle: 0,
      text: target? 'T':'L',
      fontSize: 32,
      fontFamily: 'Helvetica, Arial, Sans-Serif',
      fill: 'black'
    });
   
    break;
    case 2:
    component.options.content.push({
    type: 'rect',
    left: x, top: y, angle: 0,width:32, height:32,
    fill: target? '#FF5733':'#16A085'
  });
  break;

   case 3:
    if (target) {
      var stype = 1;
    } else {
      var stype = 2+serial_number%3;
    }
    component.options.content.push({
    type: stype%2==0?'rect':'circle',
    left: x, top: y, angle: 0,width:32, height:32,
    fill: stype>2? '#FF5733':'#16A085'
  });
  break;
  }
}

this.options.events['click canvas'] = function(e) {
    const clickCoordinates = this.transformCanvasEvent(e)
    const distance = lab.util.geometry.distance(
      clickCoordinates, [50,-25]
    )

    // There's probably a better way to handle
    // the user interface in this paradigm, e.g.
    // we could use the click as both a positive
    // and a negative answer (maybe if it's outside
    // the square?), and save the distance for
    // post-hoc analysis?
    if (distance < 30) {
      this.respond('yes')
    }
  }

window.estimates = {};
window.timeToEstimate = {};
window.trialBonuses = {};

this.options.events['click button[type="submit"]'] = function() {
  // Get slider value
  const sliderValue = document.querySelector('input[name="slider"]').value
  this.data.sliderValue = sliderValue
  this.end('response')
  window.estimates[this.parameters.trial_number] = 
  sliderValue*1000;
  window.trialBonuses[this.parameters.trial_number] = calculateBonus(sliderValue);
}

window.printChoice = function(x) {
